import { Injectable } from '@angular/core';
import { switchMap, take } from 'rxjs/operators';
import { HttpClient } from '@angular/common/http';
import { from, Observable, EMPTY, of, BehaviorSubject } from 'rxjs';
import { GameSoundResponseInterface, SoundType, SoundItemIterface, SoundTypeFactory } from 'src/modules/shared/models/sound';
import { truthy } from 'src/modules/shared/helpers/rxjs-operators.helper';

@Injectable({
  providedIn: 'root',
})
export class AudioService {
  private isSound$: Observable<boolean> = new BehaviorSubject(true);

  private knockSounds: HTMLAudioElement[] = [];
  private soundList: SoundItemIterface[] = [];

  constructor(private httpClient: HttpClient) {
	  const soundsJSON = `[{"sound_type":"any_single","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/S/C/R/zapsplat_multimedia_game_sound_glassy_bell_chime_high_pitched_collect_item_gai.mp3","file_encoded":""},{"sound_type":"any_tournament","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/G/V/Z/zapsplat_multimedia_game_sound_glassy_bell_chime_high_pitched_collect_item_gai.mp3","file_encoded":""},{"sound_type":"defeat","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/I/Y/O/zapsplat_multimedia_game_sound_childrens_soft_warm_single_chime_generic_006_49.mp3","file_encoded":""},{"sound_type":"draw","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/M/P/C/draw_accept.mp3","file_encoded":""},{"sound_type":"draw_offer","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/O/L/U/draw_offer.mp3","file_encoded":""},{"sound_type":"knock","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/O/I/G/%D1%81%D1%82%D1%83%D0%BA_1.wav","file_encoded":""},{"sound_type":"knock","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/U/A/Z/%D1%81%D1%82%D1%83%D0%BA_6.wav","file_encoded":""},{"sound_type":"knock","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/N/X/G/%D1%81%D1%82%D1%83%D0%BA_5.wav","file_encoded":""},{"sound_type":"knock","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/T/S/M/%D1%81%D1%82%D1%83%D0%BA_4.wav","file_encoded":""},{"sound_type":"knock","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/Z/C/E/%D1%81%D1%82%D1%83%D0%BA_3.wav","file_encoded":""},{"sound_type":"knock","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/Y/V/E/%D1%81%D1%82%D1%83%D0%BA_2.wav","file_encoded":""},{"sound_type":"single_game_start","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/L/V/Z/zapsplat_multimedia_game_sound_ambient_soft_mellow_chimes_warm_arpeggio_002_50.mp3","file_encoded":""},{"sound_type":"slide","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/G/E/R/%D1%81%D0%BA%D0%BE%D0%BB%D1%8C%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_2.wav","file_encoded":""},{"sound_type":"slide","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/Z/T/L/%D1%81%D0%BA%D0%BE%D0%BB%D1%8C%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_1.wav","file_encoded":""},{"sound_type":"tour_game_start","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/O/C/B/zapsplat_multimedia_game_sound_ambient_soft_mellow_chimes_warm_arpeggio_002_50.mp3","file_encoded":""},{"sound_type":"tournament_finish","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/O/T/D/zapsplat_multimedia_game_sound_childrens_soft_warm_single_chime_generic_004_49.mp3","file_encoded":""},{"sound_type":"win","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/G/P/M/zapsplat_multimedia_game_tone_synth_bright_organ_style_complete_finish_50776.mp3","file_encoded":""},{"sound_type":"zeitnot","file":"https://s3-wctour-ut-test.s3.amazonaws.com/media/game_sounds/Y/E/R/zapsplat_multimedia_game_sound_talley_high_pitched_subtle_001_50763.mp3","file_encoded":""}]`;
    of(JSON.parse(soundsJSON))
      .pipe(take(1))
      .subscribe((response) => {
        this.initSoundUrls(response);
      });
  }

  private initSoundUrls(soundLinks: GameSoundResponseInterface[]) {
    soundLinks.forEach((soundLink) => {
      const tempAudio = new Audio();
      tempAudio.src = `data:audio/wav;base64,${soundLink.file_encoded}`;
      switch (soundLink.sound_type) {
        case SoundType.KNOCK:
          this.knockSounds.push(tempAudio);
          break;
        default:
          this.soundList.push({
            audio: tempAudio, soundType: <SoundType>soundLink.sound_type
          });
          break;
      }
    });
  }

  public playSound(soundType: SoundType): Observable<any> {
    return this.isSound$
      .pipe(
        truthy(),
        switchMap(() => {
          const sound: SoundItemIterface = this.soundList.find(item => item.soundType === soundType);
          if (sound) {
            return from(sound.audio.play());
          }
          return this.playKnock();
        }),
        take(1),
      );
  }

  public playKnock(): Observable<any> {
    if (this.knockSounds && this.knockSounds.length) {
      const randomNumber = Math.floor(Math.random() * this.knockSounds.length);
      return from(this.knockSounds[randomNumber].play());
    }
    return EMPTY;
  }
}
